import React from 'react';

function FuncEmj(props){
    if(props.x===props.y && props.y===props.z){
        return ( 
            <>
                <h1 className='h1'>It is Matching.</h1>   
                <span>{props.x}</span> <span>{props.y}</span> <span>{props.z}</span>
                <hr/>
            </>
        )
    }else{
        return (
            <>    
                <h1 className='h1'>It is Not Matching.</h1>
                <span>{props.x}</span> <span>{props.y}</span> <span>{props.z}</span>
                <hr/>
            </>
        )
    }    
}

export default FuncEmj;
